import "./LineData.css";
import "./Lab1EmptyList.css";

function LineData(props) {

function clickTextWrapper(e) {
    e.stopPropagation;
    props.onEdited(props.line.key);
}

return (
    <li>
        <input type={"checkbox"} className={"checkboxes"}/>
        <input type={"text"}
               className={"textboxes"}
               onClick={(e) => clickTextWrapper(e)}
               onChange={(e) => props.onItemChanged(props.line.key, "text", e.target.value)}
               value={props.text}/>
    </li>
)
}

export default LineData;
